import React from 'react'
import { useHistory } from "react-router-dom"
const Header = () => {
    let history = useHistory()
    const handleAddJob = () => {
        history.push(`/`)
    };
    return (
        <>
         <div class="row justify-content-center">
             <div class="mt-2"><h4 className="text-center">Hire Product Roles</h4></div>
             <div class="pl-2 pt-2"><button onClick={(e)=> handleAddJob(e)} className="btn btn-warning ">View All Jobs</button></div>
           </div>


        </>
    )
}

export default Header;
